import { AppBar, Toolbar, Typography, styled, InputBase, IconButton, Menu, MenuItem, Button, Fade, Link } from '@mui/material'
import ShoppingBagTwoToneIcon from '@mui/icons-material/ShoppingBagTwoTone';
import React, { useState } from 'react'
import Badge from '@mui/material/Badge';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import PersonIcon from '@mui/icons-material/Person';
import FavoriteIcon from '@mui/icons-material/Favorite';

const StyledToolBar = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
    backgroundColor: "#f27a1a",
});
const Items = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
    backgroundColor: "#f27a1a",

});
const Search = styled("div")(({ theme }) => ({
    backgroundColor: "white",
    padding: "0 10px",
    borderRadius: theme.shape.borderRadius,
    width: "20%"
}));
const Icons = styled("box")(({ theme }) => ({
    display: "none",
    alignItems: "center",
    gap: "20px",
    color: "white",
    [theme.breakpoints.up("sm")]: {
        display: "flex"
    }
}));
const StyledBadge = styled(Badge)(({ theme }) => ({
    '& .MuiBadge-badge': {
        right: -3,
        top: 13,
        border: `2px solid ${theme.palette.background.paper}`,
        padding: '0 4px',
    },
}));

export const Navbar = () => {
    const [anchorEl, setAnchorEl] = React.useState(null);
    const open = Boolean(anchorEl);
    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };
    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <AppBar position='sticky'>
            <StyledToolBar>
                <Typography variant='h6' sx={{ display: { sx: "none,", sm: "block" } }}>
                    CATER PIE
                </Typography>
                <ShoppingBagTwoToneIcon sx={{ display: { xs: "block", sm: "none" } }} />
                <Search><InputBase placeholder='search..' /></Search>
                <Icons>
                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <FavoriteIcon />
                            <Typography>Favorilerim</Typography>
                        </StyledBadge>
                    </IconButton>
                    <Link to ="/sepetim">
                    <Button href='/sepetim'>
                    <IconButton  aria-label="cart">
                        <StyledBadge color="secondary">
                            <ShoppingCartIcon />
                            <Typography>Sepetim</Typography>
                        </StyledBadge>
                    </IconButton>
                    
                    </Button>
                    </Link>
                    <Link to="/giris">
                        <Button href="/giris">
                            <IconButton
                                aria-label="cart"
                            >

                                <StyledBadge color="secondary">
                                    <PersonIcon />
                                    <Typography>Giriş Yap</Typography>


                                </StyledBadge>
                            </IconButton>
                        </Button>
                    </Link>
                </Icons>


            </StyledToolBar>
            <Items>
                <Button
                    startIcon color='inherit'
                    id="kadin_giyim"
                    aria-controls={open ? 'kadin_giyim' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}
                >
                    Kadın Giyim

                </Button>
                <Button
                    color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'erkek_giyim' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'false' : undefined}
                    onClick={handleClick}
                >Erkek Giyim</Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'ayakkabi_canta' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    Ayakkabı&çanta
                </Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'elektronik' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    elektronik
                </Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'spor_outdoor' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    Spor&outdoor
                </Button>
                <Button color='inherit'
                    id="fade-button"
                    aria-controls={open ? 'çok_satanlar' : undefined}
                    aria-haspopup="true"
                    aria-expanded={open ? 'true' : undefined}
                    onClick={handleClick}>
                    çok satanlar
                </Button>


            </Items>
            
            <Menu
             id="kadin_giyim"
                MenuListProps={{
                    'aria-labelledby': 'kadin_giyim',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >

                <MenuItem onClick={handleClose}>deneme</MenuItem>
                <MenuItem onClick={handleClose}>Çanta</MenuItem>
                <MenuItem onClick={handleClose}>Ayakkabı</MenuItem>

            </Menu>
             
            <Menu
                id="erkek_giyim"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>

            </Menu>
            <Menu
                id="ayakkabi_canta"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
                <MenuItem onClick={handleClose}>Logout</MenuItem>

            </Menu> <Menu
                id="elektronik"
                MenuListProps={{
                    'aria-labelledby': 'fade-button',
                }}
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                TransitionComponent={Fade}
            >
                <MenuItem onClick={handleClose}>Profile</MenuItem>
                <MenuItem onClick={handleClose}>My account</MenuItem>
